import React from "react";
import { Navigate } from "react-router-dom";
const RequireAuth = ({ isAuthenticated, children }) => {
  const navigate = useNavigate();
  if (!isAuthenticated) {
    return <Navigate to="login" />;
  }
  return children;
};

export default RequireAuth;
